//import x from "../cardView"
import axios from "axios";
import { useEffect, useState  } from "react";


const INITIAL_STATE = {}


const [data, setData] = useState([]);

useEffect(() => {
  axios.get(
      "https://api.themoviedb.org/3/movie/popular?api_key=2e5d307a9142003b321ca6029b44fe63"
    )
    .then((res) => {
      setData(res.data.results);
    })
    .catch((err) => {
      console.log(err);
    });
}, [])


console.log(data)
